const countries = ['Mexico','Argentina']

function CountriesContainer() {
    useEffect(() => {
        console.log("holaaaa") 
        console.log('lista de paises',countries) ;
        
        const promesa = new Promise((res,rej) => {
            const rand = Math.random()
            console.log('random num',rand);

            setTimeout (() => {

                if (rand >= 0.5) {
                    res (countries)
                } else {
                    rej ('rechazadaaaaa')
                }
            },5000)


        })
        promesa.then((result) => {
            console.log("la promesa fue satisfehca",result);

        }).catch ((err) => {
            console.log("la promesa fue rechazada",err);

        })
    }, [])
    
  return (
    <div style={{border : 'solid'}}>
        <h1>
        {countries.map(c,i=> <li key={i}>{c}</li>)}
        </h1>
    </div>
  )
}
export default CountriesContainer
